import React from 'react';
import { Header } from '../components/Header/Header';
import { Footer } from '../components/Footer/Footer';

const CornerHealth = () => {
    return (
        <div>
            <Homepage>
				<H1 id="logo"><HomepageLink href="/">Megan Chong</HomepageLink></H1>
			</Homepage>
            <Header height="20vh"/>
            <Footer/>
        </div>
    )
}

export default CornerHealth;
